package com.shlapak.yaroslav.leetcode.problems1to100.problem3

/**
 * Created on 2019/04/08.
 */
class Solution {
    var max = 0

    fun lengthOfLongestSubstring(s: String): Int {
        val set = mutableSetOf<Char>()
        val size = s.length
        var start = 0
        var end = 0
        while (start < size && end < size) {
            val character = s.get(end)
            if (set.contains(character)) {
                set.remove(s.get(start))
                start++
            } else {
                set.add(character)
                updateMax(set.size)
                end++
            }
        }

        return max
    }

    private fun updateMax(newMax: Int) {
        if (newMax > max) {
            max = newMax
        }
    }
}

